$(".delete-feedback-btn").click((function(e){const t=e.currentTarget.id;$.ajax({type:"GET",url:`/feedbacks/delete-review/${t}`,success:function({data:e}){$(`#card-${e.feedID}`).remove(),notifyMsg("success","Feedback Deleted !!")},error:function(e){notifyMsg("error",e.responseText)}})})),notifyMsg=function(e,t){new Noty({theme:"relax",text:t,type:e,layout:"topRight",timeout:1500}).show()};